	_createdAt,
	_id,
	'img': image{
		alt,
		image{
			asset->{url}
		},
	},
    'raw': image,
`;

export const getImg = async () => {
    const data = await client.fetch(
        `*[_type == $source && slug.current == $slug]{${galleriFields}}`,
        {
          slug,
